const search = (props) => {
    if (props.name === '') {
      return (
        props.persons.map(person =>
          <li key={person.id}>{person.name}: {person.number}</li>)
      );
    } else {
      return (
        props.persons
        .filter(person => person.name.toLowerCase().startsWith(props.toLowerCase()))
        .map(person =>
          <li key={person.id}>{person.name}: {person.number}</li>)
      );
    }
  }

  export default {search};
